const { createSlice } = require("@reduxjs/toolkit");

const initialState = {
  name: "",
};

const nicknameSlice = createSlice({
  name: "NAME",
  initialState,
  reducers: {
    GET_NAME: (state, action) => {
      state.name = action.payload;
    },
  },
});

export const { GET_NAME } = nameSlice.actions;

export default nicknameSlice.reducer;
